import './App.css';
import {Button,Navbar} from 'react-bootstrap';
function App() {
  return (
    <div className="App">
    <Button variant="primary">Primary</Button>{' '}
    <Navbar bg="dark" variant="dark">
     <Container>
       <Navbar.Brand href="#home">
         <img
           alt=""
           src="/logo.svg"
           width="30"
           height="30"
           className="d-inline-block align-top"
         />{' '}
         React Bootstrap
       </Navbar.Brand>
     </Container>
   </Navbar>
   </div>

  );
}

export default App;
